import React from 'react';
import Header from '../../components/header/Header';
import Footer from '../../components/footer/Footer';
import './delivery.css';

const Delivery = () => {
    return (
        <>
            <section className='delivery'>
                <Header />
                <div className='delivery__container'>
                </div>
                <Footer />
            </section>
        </>
    )
}

export default Delivery
